import Products from "./pages/products";
import "./scss/app.scss";
import { Routes, Route } from "react-router-dom";
function App() {
  return (
    <div className="app">
      <Routes>
        <Route path={"test-task/products" || ""} element={<Products />}></Route>
      </Routes>
    </div>
  );
}

export default App;
